import React, { useEffect, useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import { MapContainer, TileLayer, Marker, Popup, Polyline } from "react-leaflet";
import "leaflet/dist/leaflet.css";

export default function RouteDetails() {
  const navigate = useNavigate();
  const location = useLocation();
  const itinerary = location.state?.itinerary || [];

  const [currentIndex, setCurrentIndex] = useState(0);
  const [fullRoute, setFullRoute] = useState([]);

  // Redirect back if no itinerary
  useEffect(() => {
    if (!itinerary.length) {
      alert("No itinerary found! Redirecting to Home.");
      navigate("/");
    }
  }, [itinerary, navigate]);

  // Build simple route coordinates (just POI order for now)
  useEffect(() => {
    if (itinerary.length) {
      const coords = itinerary.map((spot) => [spot.lat, spot.lng]);
      setFullRoute(coords);
    }
  }, [itinerary]);

  const nextPOI = () => {
    if (currentIndex < itinerary.length - 1) setCurrentIndex(currentIndex + 1);
  };

  const finishRoute = () => {
    if (window.confirm("Are you sure you want to finish the route?")) {
      alert("Route completed!");
      navigate("/");
    }
  };

  if (!itinerary.length) return null;

  const currentPOI = itinerary[currentIndex];

  return (
    <div style={{ display: "grid", gridTemplateColumns: "1fr 1fr", gap: 16 }}>
      <div style={{ height: "600px" }}>
        <MapContainer
          center={[currentPOI.lat, currentPOI.lng]}
          zoom={14}
          style={{ height: "100%", width: "100%" }}
        >
          <TileLayer
            attribution='&copy; <a href="https://www.openstreetmap.org/">OSM contributors</a>'
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          />
          <Polyline positions={fullRoute} color="blue" />
          {itinerary.map((spot, i) => (
            <Marker key={i} position={[spot.lat, spot.lng]}>
              <Popup>
                <strong>{spot.name}</strong>
                <p>{spot.description}</p>
                {spot.image && (
                  <img
                    src={spot.image}
                    alt={spot.name}
                    style={{ width: "150px", borderRadius: "8px" }}
                  />
                )}
              </Popup>
            </Marker>
          ))}
        </MapContainer>
      </div>

      <div>
        <h2>Current POI</h2>
        <p>
          <strong>{currentPOI.name}</strong>
        </p>
        <p>{currentPOI.description}</p>
        {currentPOI.image && (
          <img
            src={currentPOI.image}
            alt={currentPOI.name}
            style={{ width: "200px", borderRadius: "8px" }}
          />
        )}
        <div style={{ marginTop: 20 }}>
          {currentIndex < itinerary.length - 1 && (
            <button onClick={nextPOI}>Next POI</button>
          )}
          {currentIndex === itinerary.length - 1 && (
            <button onClick={finishRoute}>Finish Route</button>
          )}
        </div>
        <p style={{ marginTop: 20 }}>
          POI {currentIndex + 1} of {itinerary.length}
        </p>
        <p>
          Arrival: {currentPOI.arrival?.toLocaleString()} <br />
          Departure: {currentPOI.departure?.toLocaleString()}
        </p>
      </div>
    </div>
  );
}
